// src/pages/Home.js
import React from 'react';

const Home = () => {
  return (
    <div className="bg-gray-100 min-h-screen bg-cover bg-center" style={{ backgroundImage: "url('/public/Screenshot 2024-09-24 at 8.10.14 PM.png')" }}>
      {/* Navbar */}
      <nav className="bg-white shadow">
        <div className="container mx-auto px-4 py-4 flex justify-between items-center">
          <h1 className="text-xl font-bold">ISKCON Temple</h1>
          <div className="space-x-4">
            <a href="#" className="text-gray-600 hover:text-blue-500">Home</a>
            <a href="#" className="text-gray-600 hover:text-blue-500">About Us</a>
            <a href="#" className="text-gray-600 hover:text-blue-500">Events</a>
            <a href="#" className="text-gray-600 hover:text-blue-500">Contact</a>
          </div>
        </div>
      </nav>

      {/* Hero Section */}
      <header className="bg-blue-600 text-white py-20">
        <div className="container mx-auto text-center">
          <h2 className="text-3xl font-bold">Welcome to ISKCON Temple</h2>
          <p className="mt-4 text-lg">Experience spirituality and community.</p>
          <a href="#" className="mt-6 inline-block bg-white text-blue-600 px-4 py-2 rounded shadow hover:bg-gray-200">Learn More</a>
        </div>
      </header>

      {/* Footer */}
      <footer className="bg-white py-4">
        <div className="container mx-auto text-center">
          <p className="text-gray-600">© 2024 ISKCON Temple. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default Home;
